Photo by @amivitale // Happy World Elephant Day! Here, An orphaned baby elephant gets a greeting at Reteti Elephant Sanctuary (@r.e.s.c.u.e) in northern Kenya. In Samburu culture an elder greets a child or teen by placing the palm of the right hand lightly on the head...the elders are passing the goodness of their spirit from their hands as a blessing when they greet you this way.

Please follow @amivitale and @r.e.s.c.u.e to learn how to support elephants.

